INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (1, 'ES', 'España', 'Sevilla', 34.67534567543453, -5.3679866554, 'Torre del oro', 'La Torre del Oro tiene una anchura de 15 metros y una altura de 36 metros, algo más de un tercio de lo que mide la otra Torre en mayúsculas de Sevilla, la Giralda (94,69 metros) y fue declarada monumento histórico-artístico en 1931. Dicen que le debe el nombre al brillo dorado que reflejaba la torre sobre el río', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTGKKeuRsdPHtkp-Z-Gulau1AMMqLNyRUlOlQ&s');
INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (2, 'ES', 'España', 'Sevilla', 34.67534567543453, -5.3679866554, 'Plaza de españa', 'La plaza de España es un conjunto arquitectónico enclavado en el parque de María Luisa de la ciudad de Sevilla (Andalucía, España). Fue proyectada por el arquitecto Aníbal González. Se levantó entre 1914 y 1929 y es la construcción más grande de la Exposición Iberoamericana de 1929', 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Plaza_de_Espa%C3%B1a_%28Sevilla%29_-_01.jpg/1920px-Plaza_de_Espa%C3%B1a_%28Sevilla%29_-_01.jpg');
INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (3, 'ES', 'España', 'Úbeda', 39.88865385391533, 4.2667642031477016, 'Plaza Vázquez de Molina', 'Lo primero que tienes que hacer cuando llegues a Úbeda es ir a la Plaza Vázquez de Molina, ya que en ella se concentran los más importantes monumentos de interés, los cuales constituyen el mejor ejemplo de arquitectura renacentista existente en toda España.', 'https://www.vandelviraturismo.com/wp-content/uploads/2020/09/plaza-vazquez-molina-en-ubeda.jpg');
INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (4, 'FR', 'Francia', 'París', 39.88865385391533, 4.2667642031477016, 'Torre Eifel', 'La torre Eiffel(tour Eiffel, en francés), inicialmente llamada Tour de 300 mètres («Torre de 300 metros») es una estructura de hierro pudelado diseñada inicialmente por los ingenieros civiles Maurice Koechlin y Émile Nouguier y construida, tras el rediseño estético de Stephen Sauvestre, por el ingeniero civil francés Gustave Eiffel y sus colaboradores para la Exposición Universal de 1889 en París (Francia)', 'https://upload.wikimedia.org/wikipedia/commons/thumb/d/d2/Eiffelturm.JPG/280px-Eiffelturm.JPG');
INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (5, 'RU', 'Rusia', 'Moscú', 39.88865385391533, 4.2667642031477016, 'Kremlin', 'El Kremlin (nombre formal: kremlin de Moscú, en ruso Моско́вский Кремль rom. Moskovski Kreml) es una fortaleza situada en el centro de Moscú, la parte más antigua de la ciudad. Es el principal complejo sociopolítico e histórico-artístico de la ciudad y la residencia oficial del presidente de la Federación de Rusia.', 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Moscow_05-2012_Kremlin_22.jpg/1920px-Moscow_05-2012_Kremlin_22.jpg');
INSERT INTO Monumento(id, codigo_pais, nombre_pais, nombre_ciudad, latitud, longitud, nombre_monumento, descripcion, photo_url) VALUES (6, 'MEX', 'Mexico', 'Ciudad de Mexico', 39.88865385391533, 4.2667642031477016, 'Ángel de la Independencia', 'El Monumento a la Independencia o Columna de la Independencia1​ (coloquialmente, El Ángel o El Ángel de la Independencia) es una columna honoraria que se encuentra en la Ciudad de México, en la glorieta localizada en la confluencia de la avenida Paseo de la Reforma y las calles Río Tíber y Florencia. Es administrado por el Gobierno de la Ciudad de México.', 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS2QJPf50fpQzpmhtm75bslka90Ehdk3AuHAQ&s');
